import React, { Component } from "react";
const key = "23fe0646c0d1253eb430f7e02db925a0";
const token =
  "52615ebb3fb8336a474fd1ab9ec8ae053f5321433e1cbfefefb33a1779816ba9";
class List extends Component {
  constructor(props) {
    super(props);

    this.state = {
      date: [],
    };
  }

  componentDidMount() {
    this.getList();
  }

  getList = () => {
    fetch(
      `https://api.trello.com/1/boards/5e8760dd0480e75528f188ef/lists?key=${key}&token=${token}`,
      {
        method: "GET",
      }
    ).then((res) => {
      console.log(res.id);
      this.setState({
        date: res.data,
      });
    });
  };
  render() {
    return (
      <div className="list">
        <h1>Doing</h1>
        <div data={this.state.date}></div>
      </div>
    );
  }
}

export default List;
